import "./BoxLHS.css";
import Pic from "./LoginImg/LHSimages.jpg"

const BoxLHS = () => {
    return(
        <div className="BoxLHSBody">
            <img  alt="DoctorImage" width="200px" height="200px" style={{backgroundImage : `url("${Pic}")`}}/>
        </div>
    );
}

export default BoxLHS;
